    storageBucket: "lexical-acolyte-304913.appspot.com",
    messagingSenderId: "611796077490",
    appId: "1:611796077490:web:d8931e7d286835527572ab"
};
// Initialize Firebase
firebase.initializeApp(firebaseConfig);

// Get a reference to the storage service, which is used to create references in your storage bucket
var storage = firebase.storage();

// Get a reference to the storage service, which is used to create references in your storage bucket
var firestore = firebase.firestore();

// Get all of  my ticket data
const allTickets = firestore.collection("ticketreader").doc("ticketreader/ticketreader/tickets");
const netWorth = firestore.collection("ticketreader").doc("ticketreader/ticketreader/netValue");

// export default allTickets;
export default netWorth;
